const Nav = ({h1}) => {
    return (
        <nav>
            <div id="hamburger_menu" className="nav_hover"><i class="fas fa-bars"></i></div>
            <div className="logo nav_hover"></div>
            <h1>{h1}</h1>
            <div className="nav_hover"></div>
            <div className="nav_hover"></div>
            <div className="nav_hover"></div>
            <div className="nav_hover"></div>
        </nav>
    )
}

export default Nav;
